class ImageWinViewer : public AppCUI::Controls::Window
{
    ImageViewer iv;

  public:
    ImageWinViewer(const AppCUI::Graphics::Image& img, ImageRenderingMethod method, ImageScaleMethod scale)
    {
        this->Create("Image view", "d:c,w:100%,h:100%");
        iv.Create(this, "x:0,y:0,w:100%,h:100%");
        iv.SetImage(img, method, scale);
    }
    bool OnEvent(Control*, Event eventType, int) override
    {
        if (eventType == Event::EVENT_WINDOW_CLOSE)
        {
            this->Exit(0);
            return true;
        }
        return false;
    };
};

class MainWin : public AppCUI::Controls::Window
{
    Button dizzy,gdt,colorPallete, colorScales;
    ComboBox cbMethod;
    ComboBox cbScale;
    Label lbMethod;
    Label lbScale;

  public:
    MainWin()
    {
        this->Create("Image example", "d:c,w:50,h:15");
        dizzy.Create(this, "Show Dizzy image !", "x:1,y:1,w:46", BTN_SHOW_DIZZY);
        gdt.Create(this, "Show Me !", "x:1,y:3,w:46", BTN_SHOW_GDT);
        colorPallete.Create(this, "Color palette", "x:1,y:5,w:46", BTN_SHOW_COLOR_PALETTE);
        colorScales.Create(this, "Color scales", "x:1,y:7,w:46", BTN_SHOW_COLOR_SCALES);


        lbMethod.Create(this, "Method", "l:1,b:3,w:6");
        cbMethod.Create(this, "l:8,b:3,w:38", "PixelTo16ColorsSmallBlock,PixelTo64ColorsLargeBlock,Ascii art");
        cbMethod.SetCurentItemIndex(0);

        lbScale.Create(this, "Scale", "l:1,b:1,w:6");
        cbScale.Create(this, "l:8,b:1,w:38", "No scale (keep original size),50%,25%,20%,10%,5%");
        cbScale.SetCurentItemIndex(0);

    }
    ImageRenderingMethod GetMethod()
    {
        auto i = cbMethod.GetCurrentItemIndex();
        switch (i)
        {
        case 0:
            return ImageRenderingMethod::PixelTo16ColorsSmallBlock;
        case 1:
            return ImageRenderingMethod::PixelTo64ColorsLargeBlock;
        case 2:
            return ImageRenderingMethod::AsciiArt;
        default:
            return ImageRenderingMethod::PixelTo16ColorsSmallBlock;
        }
    }
    ImageScaleMethod GetScale()
    {
        auto i = cbScale.GetCurrentItemIndex();
        switch (i)
        {
        case 0:
            return ImageScaleMethod::NoScale;
        case 1:
            return ImageScaleMethod::Scale50;
        case 2:
            return ImageScaleMethod::Scale25;
        case 3:
            return ImageScaleMethod::Scale20;
        case 4:
            return ImageScaleMethod::Scale10;
        case 5:
            return ImageScaleMethod::Scale5;
        default:
            return ImageScaleMethod::NoScale;
        }
    }
    bool OnEvent(Control*, Event eventType, int controlID) override
    {
        if (eventType == Event::EVENT_WINDOW_CLOSE)
        {
            Application::Close();
            return true;
        }
        if (eventType == Event::EVENT_BUTTON_CLICKED)
        {
            if (controlID == BTN_SHOW_DIZZY)
            {
                AppCUI::Graphics::Image img;
                img.Create(256, 192);                                              // ZX Spectrum screen size
                memcpy(img.GetPixelsBuffer(), dizzy_pixels, sizeof(dizzy_pixels)); // direct memory copy
                ImageWinViewer iwv(img, GetMethod(), GetScale());
                iwv.Show();
                return true;
            }
            if (controlID == BTN_SHOW_GDT)
            {
                AppCUI::Graphics::Image img;
                img.Create(150, 150);                                          // 150x150 small icon with my face
                memcpy(img.GetPixelsBuffer(), gdt_pixels, sizeof(gdt_pixels)); // direct memory copy
                ImageWinViewer iwv(img, GetMethod(), GetScale());
                iwv.Show();
                return true;
            }
            if (controlID == BTN_SHOW_COLOR_PALETTE)
            {
                AppCUI::Graphics::Image img;
                img.Create(27, 27); // 27 = square of (9 x 9 x 9) ==> 9 = variantion on one channel (from 0 to 255)      
                int x = 0;
                int y = 0;
                for (unsigned int r = 0; r <= 256; r += 32)
                {
                    for (unsigned int g = 0; g <= 256; g += 32)
                    {
                        for (unsigned int b = 0; b <= 256; b += 32)
                        {
                            img.SetPixel(x, y, std::min<>(r, 255U), std::min<>(g, 255U), std::min<>(b, 255U), 255);
                            x++;
                            if (x == img.GetWidth())
                            {
                                x = 0;
                                y++;
                            }
                        }
                    }
                }
                ImageWinViewer iwv(img, GetMethod(), GetScale());
                iwv.Show();
                return true;
            }
            if (controlID == BTN_SHOW_COLOR_SCALES)
            {
                AppCUI::Graphics::Image img;
                img.Create(16, 7); 
                for (unsigned int bit = 1; bit<=7;bit++)
                {
                    for (unsigned int x = 0; x < 16; x++)
                    {
                        img.SetPixel(
                              x, bit - 1, x * 16 * ((bit >> 2) & 1), x * 16 * ((bit >> 1) & 1), x * 16 * (bit & 1));

                    }
                }
                ImageWinViewer iwv(img, GetMethod(), GetScale());
                iwv.Show();
                return true;
            }
        }
        return false;
    }
};
int main()
{
    if (!Application::Init())
        return 1;
    Application::AddWindow(new MainWin());
    Application::Run();
    return 0;
}
